import React, { useState } from 'react';
import { Layout, Avatar, Table, Button, Card, Progress, Row, Col, Modal } from 'antd';
import { FileAddOutlined, FileProtectOutlined, FileExclamationOutlined, EditOutlined } from '@ant-design/icons'; // Importar iconos de Ant Design
import { Link } from 'react-router-dom'; // Importar Link para redireccionamiento
import '../../Styles/EstilosAjustador.css';

const { Content } = Layout;

const UserDashboard = () => {
  const userName = localStorage.getItem('nombre') || 'User Name';
  const userAvatar = ''; // Definir URL de imagen por defecto si no hay avatar

  const [isModalVisible, setIsModalVisible] = useState(false);

  const columns = [
    {
      title: 'Name',
      dataIndex: 'name',
      key: 'name',
    },
    {
      title: 'Email',
      dataIndex: 'email',
      key: 'email',
    },
  ];

  const data = [];

  const handleAvatarClick = () => {
    setIsModalVisible(true);
  };

  const handleCancel = () => {
    setIsModalVisible(false);
  };

  const defaultAvatarUrl = 'https://static.vecteezy.com/system/resources/previews/005/337/799/non_2x/icon-image-not-found-free-vector.jpg';

  return (
    <Layout className="layout" style={{ minHeight: '100vh', backgroundColor: '#5C72CC', position: 'relative' }}>
      <div className="half-circle"></div> {/* Contenedor del medio c√≠rculo */}
      <Content style={{ padding: '0 50px' }}>
        <div className="welcome-section">
          <Row align="middle" className="welcome-row">
            <Col xs={24} md={18} className="welcome-col">
              <h1 style={{ fontSize: '37px' }}>Welcome, {userName}</h1>
            </Col>
            <Col xs={24} md={6} className="avatar-col" style={{ textAlign: 'right' }}>
              <div style={{ position: 'relative' }}>
                <Avatar size={150} src={userAvatar || defaultAvatarUrl} onClick={handleAvatarClick} style={{ cursor: 'pointer' }} />
                <Link to="/editar-perfil" style={{ position: 'absolute', bottom: '10px', right: '10px' }}>
                  <Button type="primary" shape="circle" icon={<EditOutlined />} size="large" style={{backgroundColor: '#08B8FF'}}/>
                </Link>
              </div>
            </Col>
          </Row>
          <hr style={{ border: 'none', height: '1px' }} />
        </div>

        <Row gutter={16} style={{ marginBottom: 16 }}>
          <Col span={12}>
            <Card style={{ textAlign: 'center', overflow: 'hidden', borderRadius: 20 }}>
              <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100%' }}>
                <Progress type="circle" percent={7} />
              </div>
              <p style={{ marginTop: 16 }}>Overall Progress</p>
            </Card>
          </Col>
          <Col span={12}>
            <Card style={{ textAlign: 'center', overflow: 'hidden', borderRadius: 20 }}>
              <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100%' }}>
                <Progress type="circle" percent={45} />
              </div>
              <p style={{ marginTop: 16 }}>Task Completion</p>
            </Card>
          </Col>
        </Row>

        <Table columns={columns} dataSource={data} style={{ marginTop: 16 }} />

        <Row gutter={[16, 16]} style={{ marginTop: 16, marginBottom: 20 }}>
          <Col xs={24} sm={8}>
            <Button
              type="primary"
              href="#link1"
              block
              icon={<FileAddOutlined style={{ fontSize: '20px' }} />}
              style={{ borderRadius: '50px', fontSize: 'medium', backgroundColor: 'black', border: '1px solid white', height: '40px' }}
            >
              Registrar siniestro normal
            </Button>
          </Col>
          <Col xs={24} sm={8}>
            <Button
              type="primary"
              href="#link2"
              block
              icon={<FileProtectOutlined style={{ fontSize: '20px' }} />}
              style={{ borderRadius: '50px', fontSize: 'medium', backgroundColor: 'black', border: '1px solid white', height: '40px' }}
            >
              Registrar Poliza especial
            </Button>
          </Col>
          <Col xs={24} sm={8}>
            <Button
              type="primary"
              href="#link3"
              block
              icon={<FileExclamationOutlined style={{ fontSize: '20px' }} />}
              style={{ borderRadius: '50px', fontSize: 'medium', backgroundColor: 'black', border: '1px solid white', height: '40px' }}
            >
              Registrar siniestro cancelado
            </Button>
          </Col>
        </Row>
      </Content>

      <Modal visible={isModalVisible} footer={null} onCancel={handleCancel}>
        <img src={userAvatar || defaultAvatarUrl} alt="Imagen del perfil" style={{ width: '100%' }} />
      </Modal>
    </Layout>
  );
};

export default UserDashboard;
